import React from 'react';
import { CREATE_ROOM } from "../actions";

const initialState = {
    id: 0,
    name: 'ルーム番号',
    room: []
}

const testReducer = (state = initialState, action) => {
    // console.log(state)
    switch (action.type) {
        case CREATE_ROOM:
            // console.log(state[0])
            const newRoom = (<div>{state[1]}{state[0]}</div>)
            // console.log(newRoom)
            // state[3][state[0]] = newRoom
            state[0]++;
            return state;
        default:
            return [state.id, state.name, state.room];
    }
}

export default testReducer;
